import React from "react";

export default function HighScoreTable(props) {
  const country = props.data.map((element) => <td>{element.name}</td>);
  const scores=props.data.map((element)=> <tr><td>{element.scores.map(el=> {el.n})}</td></tr>)
  return (
    <table>
      <thead>{country}</thead>
      <tbody>{scores}</tbody>
    </table>
  );
}
